    useEffect(() => {
        if(param1 && param2) {
            console.log(param1,param2)
            setError({
                param1: param1,
                param2: param2
            })
        }
    }, [param1, param2])

    return (
        <div className="not-found">
            <h1>Page Not Found</h1>
            <p>{error.param1}: {error.param2}</p>
        </div>
    )


}
